- input: "TEXT\x1CC00019380\x1CTEXT-00001\x1C\x1CF3XA\x1CJuly Monthly Report: We are
    filing this amendment in response to the FEC request for more information dated
    August 20, 2008. 1.This expenditure was made to purchase whiteboards for administrative
    purposes for use in the office, and was not part of any public communication.
    2. We have carefully reviewed all employees' hours and confirmed that, because
    they did not work over 25% of their time on Federal Election Activities, payroll
    and payroll taxes were properly paid on the administrative split. Memo notes have
    been added to these records. 3. The deposit from the Democratic Senatorial Committee
    totaling $1,080 represents the Federal portion of the original disbursement for
    services of $3000. The payment for services was split between the accounts, and
    the non-Federal portion totaling $1,920 was directly deposited into the non-Federal
    account. 4. This is an administrative cost related to building the voter database.
    This purchase was not related to any voter registration federal election activity.
    \ 5. A purpose has been included for each disbursement itemized on H4.  6. The
    disbursement for parking expenses has been listed as a separate entity from the
    mileage expenses. 7. The purpose for these expenses has been clarified. These
    expenses were made for staff meals and a party meeting. The disbursement to The
    Arrangers was a deposit made to cover chargers for a Party meeting. Neither of
    the events were fundraisers nor were the expenses made on behalf of any Federal
    candidate or candidate committee. 8. This activity has been amended and will be
    disclosed on Line 30 (b)."
